import React, { Component } from 'react'
import './AboutMe.css'

export default class AboutMe extends Component {
  render() {
    return (
      <div
        id='aboutme_jump'
        className='about-me'>
        <h1 className='about-me-blurb'>As a full-stack developer and musician currently based in NYC, I thrive and excel in creative environments.
        <br />
        <br />
        As a traveler endlessly wandering across longitudes and latitudes, I have a deep-seeded desire to help bring people together.
        <br />
        <br />
        As a dreamer I believe the future exists for us to shape and molde
        </h1>
      </div>
    )
  }
}
